import React from "react";
import Panel from "./panel";

const Dashboard = () => {
  return (
    <div className="dshbrd-1">
      <Panel w="3" convex={true}></Panel>
      <Panel w="2"></Panel>
      <Panel w="4" convex={true}>
        <Panel w="2" convex={true}></Panel>
      </Panel>
      <Panel w="1" convex={true}></Panel>
      <Panel w="3" concave={true}></Panel>
      <Panel w="5" convex={true}></Panel>
    </div>
  );
};

export default Dashboard;
